import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <React.Fragment>
      <ul>
        <li></li>
        <li></li>
        <li></li>
      </ul>
    </React.Fragment>
  );
  // 리턴을 여러개 해줄때는 부모요소가 여러개필요
  //React.Fragment or <></>
  // => 부모요소가 필요한데 실제로 랜더링 되지않게
}
export default App;
